import React, { useState, useEffect } from 'react';
import { 
  Bot, Plus, Search, Filter, RefreshCw, Eye, Send, Copy, 
  CheckCircle, Clock, AlertCircle, XCircle, Pause, Play,
  MessageSquare, Phone, ExternalLink, Download, MoreVertical
} from 'lucide-react';
import api, { endpoints } from '../api';
import { 
  Card, Button, Input, Select, Badge, Modal, DataTable, LoadingSpinner 
} from '../components/ui';
import { AIInterviewSession, Project, Beneficiary } from '../types';

// Status badge variants
const STATUS_VARIANTS: Record<string, 'default' | 'success' | 'warning' | 'danger' | 'info'> = {
  pending: 'default',
  in_progress: 'info',
  paused: 'warning',
  completed: 'success',
  abandoned: 'danger',
  expired: 'danger',
};

const AIInterviewsManagementPage: React.FC = () => {
  // State
  const [sessions, setSessions] = useState<AIInterviewSession[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Filters
  const [searchTerm, setSearchTerm] = useState('');
  const [statusFilter, setStatusFilter] = useState('');
  const [projectFilter, setProjectFilter] = useState('');

  // Modal states
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [showDetailsModal, setShowDetailsModal] = useState(false);
  const [selectedSession, setSelectedSession] = useState<AIInterviewSession | null>(null);

  // Create form state
  const [projects, setProjects] = useState<Project[]>([]);
  const [beneficiaries, setBeneficiaries] = useState<Beneficiary[]>([]);
  const [questionnaires, setQuestionnaires] = useState<any[]>([]);
  const [createForm, setCreateForm] = useState({
    project: '',
    questionnaire: '',
    beneficiary_ids: [] as number[],
    language: 'en',
  });
  const [creating, setCreating] = useState(false);

  // Load sessions
  useEffect(() => {
    loadSessions();
    loadProjects();
  }, []);

  const loadSessions = async () => {
    setLoading(true);
    try {
      const response = await api.get<{ results: AIInterviewSession[] }>(endpoints.aiSessions);
      setSessions(response.results || []);
    } catch (err: any) {
      setError(err.message || 'Failed to load AI interview sessions');
    } finally {
      setLoading(false);
    }
  };

  const loadProjects = async () => {
    try {
      const response = await api.get<{ results: Project[] }>(endpoints.projects);
      setProjects(response.results || []);
    } catch (err) {
      console.error('Failed to load projects:', err);
    }
  };

  const loadBeneficiaries = async (projectId: string) => {
    if (!projectId) {
      setBeneficiaries([]);
      return;
    }
    try {
      const response = await api.get<{ results: Beneficiary[] }>(
        `${endpoints.beneficiaries}?project=${projectId}&is_sampled=true&is_interviewed=false`
      );
      setBeneficiaries(response.results || []);
    } catch (err) {
      console.error('Failed to load beneficiaries:', err);
    }
  };

  const loadQuestionnaires = async (projectId: string) => {
    if (!projectId) {
      setQuestionnaires([]);
      return;
    }
    try {
      const response = await api.get<{ results: any[] }>(
        `${endpoints.projectQuestionnaires}?project=${projectId}`
      );
      setQuestionnaires(response.results || []);
    } catch (err) {
      console.error('Failed to load questionnaires:', err);
    }
  };

  const handleProjectChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    const projectId = e.target.value;
    setCreateForm(prev => ({ ...prev, project: projectId, questionnaire: '', beneficiary_ids: [] }));
    loadBeneficiaries(projectId);
    loadQuestionnaires(projectId);
  };

  const handleCreateSessions = async () => {
    if (!createForm.project || !createForm.questionnaire || createForm.beneficiary_ids.length === 0) {
      setError('Please select project, questionnaire, and at least one beneficiary');
      return;
    }

    setCreating(true);
    try {
      const response = await api.post<{ created: AIInterviewSession[]; errors: any[] }>(
        `${endpoints.aiSessions}bulk_create/`,
        {
          project: parseInt(createForm.project),
          questionnaire: parseInt(createForm.questionnaire),
          beneficiary_ids: createForm.beneficiary_ids,
          language: createForm.language,
        }
      );

      if (response.created.length > 0) {
        loadSessions();
        setShowCreateModal(false);
        setCreateForm({ project: '', questionnaire: '', beneficiary_ids: [], language: 'en' });
      }

      if (response.errors.length > 0) {
        setError(`Created ${response.created.length} sessions. ${response.errors.length} errors occurred.`);
      }
    } catch (err: any) {
      setError(err.message || 'Failed to create sessions');
    } finally {
      setCreating(false);
    }
  };

  const handleCopyLink = (session: AIInterviewSession) => {
    const link = `${window.location.origin}/ai-interview/${session.access_token}`;
    navigator.clipboard.writeText(link);
    alert('Interview link copied to clipboard!');
  };

  const handleSendLink = async (session: AIInterviewSession) => {
    // In a real app, this would trigger SMS/WhatsApp/Email
    alert(`Link would be sent to ${session.beneficiary_phone}`);
  };

  const viewSessionDetails = (session: AIInterviewSession) => {
    setSelectedSession(session);
    setShowDetailsModal(true);
  };

  // Filter sessions
  const filteredSessions = sessions.filter(session => {
    const matchesSearch = 
      session.beneficiary_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      session.project_code.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesStatus = !statusFilter || session.status === statusFilter;
    const matchesProject = !projectFilter || session.project.toString() === projectFilter;
    return matchesSearch && matchesStatus && matchesProject;
  });

  // Table columns
  const columns = [
    {
      key: 'beneficiary_name',
      label: 'Beneficiary',
      render: (session: AIInterviewSession) => (
        <div>
          <div className="font-medium">{session.beneficiary_name}</div>
          <div className="text-sm text-gray-500">{session.beneficiary_phone}</div>
        </div>
      ),
    },
    {
      key: 'project_code',
      label: 'Project',
      render: (session: AIInterviewSession) => (
        <div>
          <div className="font-medium">{session.project_code}</div>
          <div className="text-sm text-gray-500">{session.questionnaire_name}</div>
        </div>
      ),
    },
    {
      key: 'status',
      label: 'Status',
      render: (session: AIInterviewSession) => (
        <Badge variant={STATUS_VARIANTS[session.status] || 'default'}>
          {session.status_display}
        </Badge>
      ),
    },
    {
      key: 'progress',
      label: 'Progress',
      render: (session: AIInterviewSession) => (
        <div className="flex items-center">
          <div className="w-24 bg-gray-200 rounded-full h-2 mr-2">
            <div
              className="bg-blue-600 h-2 rounded-full"
              style={{ width: `${session.progress_percentage}%` }}
            />
          </div>
          <span className="text-sm text-gray-600">
            {session.answered_questions}/{session.total_questions}
          </span>
        </div>
      ),
    },
    {
      key: 'language',
      label: 'Language',
      render: (session: AIInterviewSession) => (
        <span className="text-sm">{session.language_display}</span>
      ),
    },
    {
      key: 'created_at',
      label: 'Created',
      render: (session: AIInterviewSession) => (
        <span className="text-sm text-gray-500">
          {new Date(session.created_at).toLocaleDateString()}
        </span>
      ),
    },
    {
      key: 'actions',
      label: 'Actions',
      render: (session: AIInterviewSession) => (
        <div className="flex items-center space-x-1">
          <button
            onClick={() => viewSessionDetails(session)}
            className="p-1.5 text-gray-500 hover:text-blue-600 hover:bg-blue-50 rounded"
            title="View Details"
          >
            <Eye className="w-4 h-4" />
          </button>
          <button
            onClick={() => handleCopyLink(session)}
            className="p-1.5 text-gray-500 hover:text-green-600 hover:bg-green-50 rounded"
            title="Copy Link"
          >
            <Copy className="w-4 h-4" />
          </button>
          <button
            onClick={() => handleSendLink(session)}
            className="p-1.5 text-gray-500 hover:text-purple-600 hover:bg-purple-50 rounded"
            title="Send Link"
          >
            <Send className="w-4 h-4" />
          </button>
          <a
            href={`/ai-interview/${session.access_token}`}
            target="_blank"
            rel="noopener noreferrer"
            className="p-1.5 text-gray-500 hover:text-blue-600 hover:bg-blue-50 rounded"
            title="Open Interview"
          >
            <ExternalLink className="w-4 h-4" />
          </a>
        </div>
      ),
    },
  ];

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div className="flex items-center">
          <Bot className="w-8 h-8 text-blue-500 mr-3" />
          <div>
            <h1 className="text-2xl font-bold text-gray-900">AI Voice Interviews</h1>
            <p className="text-sm text-gray-500">
              Manage AI-powered voice interviews for beneficiaries
            </p>
          </div>
        </div>
        <Button onClick={() => setShowCreateModal(true)}>
          <Plus className="w-4 h-4 mr-2" />
          Create Sessions
        </Button>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
        <Card className="p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Total Sessions</p>
              <p className="text-2xl font-bold">{sessions.length}</p>
            </div>
            <MessageSquare className="w-10 h-10 text-blue-500 opacity-50" />
          </div>
        </Card>
        <Card className="p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">In Progress</p>
              <p className="text-2xl font-bold">
                {sessions.filter(s => s.status === 'in_progress').length}
              </p>
            </div>
            <Play className="w-10 h-10 text-blue-500 opacity-50" />
          </div>
        </Card>
        <Card className="p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Completed</p>
              <p className="text-2xl font-bold">
                {sessions.filter(s => s.status === 'completed').length}
              </p>
            </div>
            <CheckCircle className="w-10 h-10 text-green-500 opacity-50" />
          </div>
        </Card>
        <Card className="p-4">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Pending</p>
              <p className="text-2xl font-bold">
                {sessions.filter(s => s.status === 'pending').length}
              </p>
            </div>
            <Clock className="w-10 h-10 text-yellow-500 opacity-50" />
          </div>
        </Card>
      </div>

      {/* Filters */}
      <Card className="p-4">
        <div className="flex flex-wrap gap-4">
          <div className="flex-1 min-w-[200px]">
            <div className="relative">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-gray-400" />
              <input
                type="text"
                placeholder="Search by beneficiary or project..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-10 pr-4 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
              />
            </div>
          </div>
          <select
            value={statusFilter}
            onChange={(e) => setStatusFilter(e.target.value)}
            className="px-3 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500"
          >
            <option value="">All Statuses</option>
            <option value="pending">Pending</option>
            <option value="in_progress">In Progress</option>
            <option value="paused">Paused</option>
            <option value="completed">Completed</option>
            <option value="expired">Expired</option>
          </select>
          <select
            value={projectFilter}
            onChange={(e) => setProjectFilter(e.target.value)}
            className="px-3 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500"
          >
            <option value="">All Projects</option>
            {projects.map(p => (
              <option key={p.id} value={p.id}>{p.code} - {p.title}</option>
            ))}
          </select>
          <Button variant="secondary" onClick={loadSessions}>
            <RefreshCw className="w-4 h-4 mr-2" />
            Refresh
          </Button>
        </div>
      </Card>

      {/* Sessions Table */}
      <Card>
        {error && (
          <div className="p-4 bg-red-50 border-b border-red-200 text-red-700">
            {error}
            <button onClick={() => setError('')} className="float-right"></button>
          </div>
        )}
        <DataTable
          columns={columns}
          data={filteredSessions}
          loading={loading}
        />
      </Card>

      {/* Create Modal */}
      <Modal
        isOpen={showCreateModal}
        onClose={() => setShowCreateModal(false)}
        title="Create AI Interview Sessions"
      >
        <div className="space-y-4">
          <Select
            label="Project"
            name="project"
            value={createForm.project}
            onChange={handleProjectChange}
            options={[
              { value: '', label: 'Select Project' },
              ...projects.map(p => ({ value: p.id.toString(), label: `${p.code} - ${p.title}` }))
            ]}
          />

          <Select
            label="Questionnaire"
            name="questionnaire"
            value={createForm.questionnaire}
            onChange={(e) => setCreateForm(prev => ({ ...prev, questionnaire: e.target.value }))}
            options={[
              { value: '', label: 'Select Questionnaire' },
              ...questionnaires.map(q => ({ value: q.id.toString(), label: q.display_name || q.template?.name }))
            ]}
          />

          <Select
            label="Language"
            name="language"
            value={createForm.language}
            onChange={(e) => setCreateForm(prev => ({ ...prev, language: e.target.value }))}
            options={[
              { value: 'en', label: 'English' },
              { value: 'hi', label: 'Hindi' },
              { value: 'bn', label: 'Bengali' },
              { value: 'te', label: 'Telugu' },
              { value: 'mr', label: 'Marathi' },
              { value: 'ta', label: 'Tamil' },
            ]}
          />

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Select Beneficiaries ({createForm.beneficiary_ids.length} selected)
            </label>
            <div className="border rounded-lg max-h-48 overflow-y-auto">
              {beneficiaries.length === 0 ? (
                <p className="p-4 text-sm text-gray-500 text-center">
                  {createForm.project ? 'No eligible beneficiaries found' : 'Select a project first'}
                </p>
              ) : (
                beneficiaries.map(ben => (
                  <label
                    key={ben.id}
                    className="flex items-center p-3 hover:bg-gray-50 cursor-pointer border-b last:border-b-0"
                  >
                    <input
                      type="checkbox"
                      checked={createForm.beneficiary_ids.includes(ben.id)}
                      onChange={(e) => {
                        if (e.target.checked) {
                          setCreateForm(prev => ({
                            ...prev,
                            beneficiary_ids: [...prev.beneficiary_ids, ben.id]
                          }));
                        } else {
                          setCreateForm(prev => ({
                            ...prev,
                            beneficiary_ids: prev.beneficiary_ids.filter(id => id !== ben.id)
                          }));
                        }
                      }}
                      className="mr-3"
                    />
                    <div>
                      <div className="font-medium">{ben.name}</div>
                      <div className="text-sm text-gray-500">{ben.phone}  {ben.village}</div>
                    </div>
                  </label>
                ))
              )}
            </div>
            {beneficiaries.length > 0 && (
              <div className="mt-2 flex space-x-2">
                <button
                  onClick={() => setCreateForm(prev => ({
                    ...prev,
                    beneficiary_ids: beneficiaries.map(b => b.id)
                  }))}
                  className="text-sm text-blue-600 hover:underline"
                >
                  Select All
                </button>
                <button
                  onClick={() => setCreateForm(prev => ({ ...prev, beneficiary_ids: [] }))}
                  className="text-sm text-gray-600 hover:underline"
                >
                  Clear
                </button>
              </div>
            )}
          </div>

          <div className="flex justify-end space-x-3 pt-4">
            <Button variant="secondary" onClick={() => setShowCreateModal(false)}>
              Cancel
            </Button>
            <Button onClick={handleCreateSessions} disabled={creating}>
              {creating ? <LoadingSpinner size="sm" /> : 'Create Sessions'}
            </Button>
          </div>
        </div>
      </Modal>

      {/* Details Modal */}
      <Modal
        isOpen={showDetailsModal}
        onClose={() => setShowDetailsModal(false)}
        title="Interview Session Details"
      >
        {selectedSession && (
          <div className="space-y-4">
            <div className="grid grid-cols-2 gap-4">
              <div>
                <p className="text-sm text-gray-500">Beneficiary</p>
                <p className="font-medium">{selectedSession.beneficiary_name}</p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Phone</p>
                <p className="font-medium">{selectedSession.beneficiary_phone}</p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Project</p>
                <p className="font-medium">{selectedSession.project_code}</p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Status</p>
                <Badge variant={STATUS_VARIANTS[selectedSession.status]}>
                  {selectedSession.status_display}
                </Badge>
              </div>
              <div>
                <p className="text-sm text-gray-500">Progress</p>
                <p className="font-medium">
                  {selectedSession.answered_questions} / {selectedSession.total_questions} questions
                </p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Language</p>
                <p className="font-medium">{selectedSession.language_display}</p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Created</p>
                <p className="font-medium">
                  {new Date(selectedSession.created_at).toLocaleString()}
                </p>
              </div>
              <div>
                <p className="text-sm text-gray-500">Expires</p>
                <p className="font-medium">
                  {new Date(selectedSession.expires_at).toLocaleString()}
                </p>
              </div>
            </div>

            <div className="border-t pt-4">
              <p className="text-sm text-gray-500 mb-2">Interview Link</p>
              <div className="flex items-center space-x-2">
                <input
                  type="text"
                  readOnly
                  value={`${window.location.origin}/ai-interview/${selectedSession.access_token}`}
                  className="flex-1 px-3 py-2 border rounded bg-gray-50 text-sm"
                />
                <Button
                  variant="secondary"
                  onClick={() => handleCopyLink(selectedSession)}
                >
                  <Copy className="w-4 h-4" />
                </Button>
              </div>
            </div>

            <div className="flex justify-end space-x-3 pt-4">
              <Button variant="secondary" onClick={() => setShowDetailsModal(false)}>
                Close
              </Button>
              <a
                href={`/ai-interview/${selectedSession.access_token}`}
                target="_blank"
                rel="noopener noreferrer"
              >
                <Button>
                  <ExternalLink className="w-4 h-4 mr-2" />
                  Open Interview
                </Button>
              </a>
            </div>
          </div>
        )}
      </Modal>
    </div>
  );
};

export default AIInterviewsManagementPage;
